description:
Dhamkee | 1973 | Crime~Drama | 785 MB | x264~MP3 | Phantom

Two hit men are sent to Mumbai to deliver a secret message to a mysterious doctor named Mehta. The men are hired by Al-Sheik, a wicked person who wants to kill his nephew and become the Sultan of Arabia. At the airport the two hit men are intercepted by police officer Rajesh who must now uncover the criminal plot and discover Dr. Mehta to seek the truth. Who is Dr.Mehta and what message is he set to decipher? Will Al-Sheik succeed in taking the throne?

